    false,nt"url": null,nt"notes": "The Seal Island puffin colony, once the
    largest in Maine, was completely destroyed by meat, egg, and feather market and
    subsistence hunters in the late 1800's. Although numbers at the two remaining colonies
    in the Gulf of Maine have slowly increased over the past century, no natural recolonization
    of former colonies has occurred. Overall, the western Atlantic population has been
    in a serious decline since the 1920's. Seal Island was also once the site of an
    important tern colony which was eventually taken over by gulls in the 1950's. The
    purpose of this action is to restore the former puffin colony through chick rearing
    and release, to protect it through gull removal and to encourage terns to nest there
    again.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
